pub const WHITE_SPACE_RANGES = [_]Range{
    .{ .start = 0x0009, .end = 0x000D },
    .{ .start = 0x0020, .end = 0x0020 },
    .{ .start = 0x0085, .end = 0x0085 },
    .{ .start = 0x00A0, .end = 0x00A0 },
    .{ .start = 0x1680, .end = 0x1680 },
    .{ .start = 0x2000, .end = 0x200A },
    .{ .start = 0x2028, .end = 0x2029 },
    .{ .start = 0x202F, .end = 0x202F },
    .{ .start = 0x205F, .end = 0x205F },
    .{ .start = 0x3000, .end = 0x3000 },
};

pub fn isLetter(cp: CodePoint) bool {
    return inRanges(cp, &LETTER_RANGES);
}

pub fn isMark(cp: CodePoint) bool {
    return inRanges(cp, &MARK_RANGES);
}

pub fn isNumber(cp: CodePoint) bool {
    return inRanges(cp, &NUMBER_RANGES);
}

pub fn isPunctuation(cp: CodePoint) bool {
    return inRanges(cp, &PUNCT_RANGES);
}

pub fn isSymbol(cp: CodePoint) bool {
    return inRanges(cp, &SYMBOL_RANGES);
}

pub fn isOther(cp: CodePoint) bool {
    return inRanges(cp, &OTHER_RANGES);
}

pub fn isWhitespace(cp: CodePoint) bool {
    return inRanges(cp, &WHITE_SPACE_RANGES);
}

pub fn isLu(cp: CodePoint) bool {
    return inRanges(cp, &LU_RANGES);
}

pub fn isLl(cp: CodePoint) bool {
    return inRanges(cp, &LL_RANGES);
}

pub fn isLt(cp: CodePoint) bool {
    return inRanges(cp, &LT_RANGES);
}

pub fn isLm(cp: CodePoint) bool {
    return inRanges(cp, &LM_RANGES);
}

pub fn isLo(cp: CodePoint) bool {
    return inRanges(cp, &LO_RANGES);
}

